// Go to contacts page
cy.get('#navBarWithDropdown').find('li.nav-item').contains(_domData.default.headerMenuItems[2]).should('exist').click({
  force: true
});
// Check the number of stores
cy.get('.pp-blog-item').as('stores').should('exist');
cy.get('@stores').should('have.length', _domData.default.stores.length);
// Check the info of each store
cy.get('@stores').each(($el, index) => {
  cy.wrap($el).should('contain.text', _domData.default.stores[index].name);
  cy.wrap($el).should('contain.text', _domData.default.stores[index].street);
  cy.wrap($el).should('contain.text', _domData.default.stores[index].city);
  cy.wrap($el).invoke('text').then(text => {
    const cleanedText = text.replace(/\s+/g, ' ').trim();
    expect(cleanedText).to.contain(_domData.default.stores[index].openingHours);
  });
});

// Iterate trough all the languages
_languages.default.forEach((language, index) => {
  // Check the URL
  cy.url().should('eq', language.url);
  // Check the title
  cy.title().should('eq', language.title);
  // Check search field placeholder
  cy.get('#desktopsearch > form > input[type="search"]').as('searchField').should('exist');
  cy.get('@searchField').should('have.attr', 'placeholder', language.searchPlaceholder);
  // Check description of the flag image
  cy.get('#languageChooser').as('flag').should('exist');
  cy.get('@flag').find('#flag > img').should('have.attr', 'alt', language.flagAlt);
  // Change the language
  cy.get('@flag').click();
  cy.get('#languageDropdown').as('otherLanguages').should('be.visible');
  cy.get('@otherLanguages').find('.btn').should('have.length', _languages.default.length - 1);
  if (index !== _languages.default.length - 1) {
    cy.intercept('GET', '**/api/v1/widget/translations/lang/**').as('reloadTime');
    cy.get('@otherLanguages').find('.btn').eq(index).click();
    cy.wait('@reloadTime');
  }
});
